import TablaTrabajadores from "../../components/dashboard/TablaTrabajadores";
import { Row, Col, Table, Card, CardTitle, CardBody } from "reactstrap";

const Tables = () => {
  return (
    <Row>
      <Col lg="12">
        <TablaTrabajadores />
      </Col>
    </Row>
  );
};

export default Tables;
